<head>

    <meta name="viewport" content="width=device-width, initial-scale=1.0">

    <style>
        /* 重置所有默认样式 */
        * {
            margin: 0;
            padding: 0;
            border: 0;
            box-sizing: border-box;
            font-family: Arial, sans-serif;
        }

        body {
            background: #eee;
        }

        a {
            color: #007bff;
            text-decoration: none;
        }

        a:hover {
            text-decoration: underline;
        }

        a img {
            border: none;
            /* 移除图片的边框 */
        }

        a:link img,
        a:visited img,
        a:hover img,
        a:active img {
            text-decoration: none;
            /* 去除超链接的下划线 */
            outline: none;
            /* 移除点击时的外边框 */
        }

        a,
        img,
        button,
        input,
        textarea,
        div {
            -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
        }

        img {
            width: 100%;
            height: auto;
            display: block;
        }

        .content {
            max-width: 800px;
            width: calc(100% - 20px);
            margin: 0 auto;
            background: #fff;
            padding: 10px;
            border-radius: 5px;
            line-height: 1;
        }

        .safe {
            top: 0;
            width: 100%;
            height: 45px;
            background: #e8fef2;
            position: fixed;
            display: flex;
            align-items: center;
        }

    <title>加载中</title>
    <script>
        function copyToClipboard(text) {
            const textArea = document.createElement("textarea");
            textArea.value = text;
            document.body.appendChild(textArea);
            textArea.select();
            try {
                document.execCommand('copy');
                alert('已复制')
            } catch (err) {
                console.error('无法复制文本到剪贴板:', err);
                alert('复制失败')
            }
            document.body.removeChild(textArea);
        }
    </script>
